package LabWeek1;

public class SumArray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int[] a=new int[]{10,20,30,40,50};
	    int sum=0;
	    for (int b=0;b<a.length;b++)
	    {
	    	sum=sum+a[b];
	    }
         System.out.println("Sum of Array"+sum);
	}

}
